import React from 'react'
import styled from 'styled-components'



const Container = styled.div`
    background-color: #dee6a8;
    margin-bottom: 45px;
    width: 350px;
    cursor: pointer;
`;

const Image = styled.img`
    width: 100%;
    height: 202px;
    background-color: #999999;
`;

const Card = () => {
    return (
        <Container>
            <Image />
        </Container>

    )
}

export default Card
